import LoginPage from "../Views/WebSite/LoginPage.js";
import RegisterPage from "../Views/WebSite/RegisterPage.js";
import Services from "../Views/WebSite/ServicesPage.js";
import About from "../Views/WebSite/AboutPage.js";
import Contact from "../Views/WebSite/ContactPage.js";
import Home from "../Views/WebSite/HomePage.js";
import CourseDetails from "../Views/WebSite/CourseDetailsPage.js";

var dashRoutes = [   
    {
        path: "/login-page",
        name: "Login Page",
        mini: "L",
        component: LoginPage,
        layout: "/auth"
    },
    {
        path: "/register-page",
        name: "Register Page",
        mini: "R",
        component: RegisterPage,
        layout: "/auth"
    },
    {
        path: "/verify",
        name: "Verification Page",
        mini: "V",
        component: VerificationPage,
        layout: "/auth"
    },
    {
        path: "/services",
        name: "Services",
        mini: "S",
        component: Services,
        layout: "/auth"
    },
    {
        path: "/about",
        name: "AboutUs",
        mini: "A",
        component: About,
        layout: "/auth"
    },
    {
        path: "/contact",
        name: "Contact",
        mini: "C",
        component: Contact,
        layout: "/auth"
    },
    {
        path: "/home",
        name: "Home",
        mini: "H",
        component: Home,
        layout: "/auth"
    },
    {
        path: "/course/details/:id",
        name: "Home",
        mini: "H",
        component: CourseDetails,
        layout: "/auth"
    }
];
export default dashRoutes;
